import React from "react";
import { useSelector } from "react-redux";
import { initializeUseSelector } from "react-redux/es/hooks/useSelector";

const TodoList = () => {
  const todos = UseSelector((state) => state.todo.todolist);
  console.log(todos);
  return <div></div>;
};

export default TodoList;
